import styles from "./BannerFifth.module.css"
import banner from "../../assets/img/BannerFifth.svg" 


const BannerFifth = () => {
    return(
        <div className={styles.BannerFifth_main}>
            <img src={banner} alt="" />
        </div>
    )
}

export default BannerFifth
